p>Cards formed by \"mating\" <em>{{_left|name}} </em>with another card. eg: \"{{_left|name}}<strong>+</strong>mate\".</p>'),(6406,'2014-07-25 13:33:45',316,1,'{\"type\": \"Layout\"}'),(6410,'2014-07-25 13:33:45',151,1,'<p>[[Config|Configuration]]</p>\r\n<p>[[*account|Accounts]]</p>'),(6412,'2014-07-25 13:33:45',85,1,'<p>[[/?view=new|Add a card]]</p>'),(6419,'2014-07-25 13:33:45',790,15,'vehicle_square72opaque2.png\nimage/png\n2020\nstandard'),(6426,'2014-07-25 13:33:45',789,1,'<div>{{+image}}</div>\r\n<div><a href=\"http://wagn.org\">Wagn v{{*version}}</a></div>'),(6453,'2014-07-25 13:33:45',210,1,'<p>Everyone has this role, whether signed in or not. [[http://wagn.org/account|more]]</p>'),(6458,'2014-07-25 13:33:45',147,1,'<p>Administrators can create, read, update and delete any card. [[http://wagn.org/permissions|more]]</p>'),(6461,'2014-07-25 13:33:45',211,1,'<p>Anyone who is signed in has this role. [[http://wagn.org/account|more]]</p>'),(6465,'2014-07-25 13:33:45',180,1,'<p><span><span>Every card has a type, which shapes the kind of information it holds. [[http://wagn.org/card_types|more]]<br></span></span></p>'),(6466,'2014-07-25 13:33:45',215,1,'<p>File cards are for uploading and downloading files. [[http://wagn.org/File|more]]</p>'),(6467,'2014-07-25 13:33:45',202,1,'<p>These cards allow unrestricted HTML. [[http://wagn.org/wagn/HTML|more]]</p>'),(6470,'2014-07-25 13:33:45',214,1,'<p>Upload images to these cards and include them anywhere. [[http://wagn.org/Image|more]]</p>'),(6471,'2014-07-25 13:33:45',406,1,'<p>Can contain only numerical values.</p>'),(6473,'2014-07-25 13:33:45',213,1,'<p><span><span>Pointers list one or more other cards. [[http://wagn.org/Pointer|more]]<br></span></span></p>'),(6477,'2014-07-25 13:33:45',787,1,'[[select]]'),(6515,'2014-07-25 13:33:45',796,1,'{\"name\":\"_self\"}'),(6516,'2014-07-25 13:33:45',797,1,'[[Administrator]]'),(6518,'2014-07-25 13:33:45',798,1,'{\"name\":\"_self\"}'),(6519,'2014-07-25 13:33:45',799,1,'<p>A favicon (or shortcut icon) is a small image used by browsers to help identify your website. [[http://www.wagn.org/wagn/favicon|How to customize your favicon]]</p>'),(6528,'2014-07-25 13:33:45',800,1,''),(6555,'2014-07-25 13:33:45',801,1,'<h1>Create</h1>\r\n<em>Wagn. For the Organizing Artist</em>\r\n<aside>\r\n<h2>The Wagn Way</h2>\r\n<p>DRY: Don\'t Repeat Yourself.  Most projects wind up with data copied all over the place: on the website, in a database, in email, etc.  Wagn helps you organize data for use and reuse in many different contexts. When you update it once, you update it everywhere.</p>\r\n</aside>\r\n<ul>\r\n<li>\r\n<h2>Database</h2>\r\n<p>Complex structures without the complex interface. [[http://wagn.org/types|Types]], [[http://wagn.org/compound_names|compound names]], [[http://wagn.org/formatting|formatting]], and a native [[http://wagn.org/WQL|query language]] comprise a powerful bottom-up data-organizing toolset. <em>[[http://wagn.org/structure|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>Website</h2>\r\n<p>[[http://wagn.org/layouts|Layouts]] and [[http://wagn.org/views|views]] help you present information flexibly and beautifully. <em>[[http://wagn.org/pages|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>Workflow</h2>\r\n<p>Web submissions, project proposals, meeting records, customer info, research, sketches, reports...  Wagn helps teams create, evolve, and connect all their information flows in fluid and adaptive ways. <em>[[http://wagn.org/wagneering|Howto]]</em></p>\r\n</li>\r\n</ul>\r\n<h1>Collaborate</h1>\r\n<em>Wagn. Go Together</em>\r\n<aside>\r\n<h2>The Wagn Way</h2>\r\n<p>Any interface you don\'t use is noise. Wagn quiets edit interface for those who just want to read, quiets configuration interface quiet for those who just want to edit content, and quiets coding syntax for site managers.</p>\r\n</aside>\r\n<ul>\r\n<li>\r\n<h2>Accounts</h2>\r\n<p>Configure [[http://wagn.org/accounts|accounts]] and [[http://wagn.org/roles|roles]] to make your Wagn as open or closed as desired. <em>[[http://wagn.org/accounts|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>Permissions</h2>\r\n<p>An elegant [[http://wagn.org/permissions|permissions]] system allows fine-grained control over who can create, read, update, and delete. <em>[[http://wagn.org/permissions|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>History</h2>\r\n<p>Don\'t worry about breaking things. Every card has a revision [[http://wagn.org/history|history]], and even [[http://wagn.org/deleting|deleting]] cards doesn\'t permanently destroy them, it just puts them in the trash.  So all changes can be reviewed and reversed. <em>[[http://wagn.org/history|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>Evolution</h2>\r\n<p>Building great collaborative websites requires thoughtfully adapting technology to community needs. Wagn is designed to evolve with you. <em>[[http://wagn.org/wagneering|Howto]]</em></p>\r\n</li>\r\n</ul>\r\n<h1>Explore</h1>\r\n<em>Wagn. How Pioneers Roll.</em>\r\n<aside>\r\n<h2>The Wagn Way</h2>\r\n<p>Context matters. Most web systems can only be managed in a separate \"admin area\", so fixing problems means shifting context entirely.  Wagn minimizes context shifts by letting you make changes in place wherever you see the need.</p>\r\n</aside>\r\n<ul>\r\n<li>\r\n<h2>Cards</h2>\r\n<p>[[http://wagn.org/cards|Cards]] are Wagn\'s building blocks. Everything – text, files, images, accounts, etc. – is in a card. <em>[[http://wagn.org/cards|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>Types</h2>\r\n<p>Every card has a [[http://wagn.org/type|type]]. Many types, like [[http://wagn.org/users|users]], [[http://wagn.org/image|images]], and [[http://wagn.org/search|searches]], come with Wagn out of the box, and you can create new types as you go. <em>[[http://wagn.org/type|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>Navbox</h2>\r\n<p>The [[http://wagn.org/navbox|navbox]] is a search bar, an auto-completer, and a shortcut for creating new cards. <em>[[http://wagn.org/navbox|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>Menus</h2>\r\n<p>Card [[http://wagn.org/menus|menus]] let you navigate, edit, configure, and administer without shifting context. <em>[[http://wagn.org/menus|Howto]]</em></p>\r\n</li>\r\n<li>\r\n<h2>Rules</h2>\r\n<p>The heart of configuring Wagn is creating [[http://wagn.org/rules|rules]].  Reached via the \"advanced\" menu item, rules control every aspect of a card\'s behavior and appearance, from [[http://wagn.org/permissions|permissions]] to [[http://wagn.org/formatting|formatting]] to [[http://wagn.org/help_text|help text]] and beyond. <em>[[http://wagn.org/rules|Howto]]</em></p>\r\n</li>\r\n</ul>\r\n'),(6556,'2014-07-25 13:33:45',79,15,'sample_logo.png\nimage/png\n9063\nstandard'),(6564,'2014-07-25 13:33:45',81,1,'<div>[[/ | {{*logo|content}}]]</div>\r\n<div> </div>\r\n<div>{{Menu|open}}</div>\r\n<div> </div>\r\n<div>\r\n<div>{{Wagneer Menu|open}}</div>\r\n<div> </div>\r\n</div>\r\n<div>{{Administrator Menu|open}}</div>\r\n<div> </div>\r\n<div>{{*credit|content}}</div>'),(6566,'2014-07-25 13:33:45',103,15,'favicon.ico\nimage/vnd.microsoft.icon\n606\nstandard'),(6568,'2014-07-25 13:33:45',795,1,'<p><strong>[[http://wagn.org/Features| features]]</strong>: [[http://wagn.org/cards|cards]], [[http://wagn.org/types|types]], [[http://wagn.org/inclusions|inclusions]], [[http://wagn.org/views|views]], [[http://wagn.org/rules|rules]], [[http://wagn.org/layouts|layouts]], [[http://wagn.org/formatting|formatting]], [[http://wagn.org/accounts|accounts]], [[http://wagn.org/permissions|permissions]]</p>\r\n<p><strong>[[http://wagn.org/Syntax Reference|syntax]]</strong>: [[http://wagn.org/link_syntax|links]], [[http://wagn.org/inclusion_syntax|inclusions]], [[http://wagn.org/WQL_syntax|queries]]</p>'),(6574,'2014-07-25 13:33:45',281,1,'<p>HTML structure of card\'s page  <em>[[http://wagn.org/layouts | more]]</em></p>'),(6715,'2014-07-25 13:33:45',942,1,'<p>{{+description}}</p>\n<p>&nbsp;</p>\n<p>[[/new/{{_self|linkname}}|add {{_self|name}} card]]</p>\n<p>&nbsp;</p>\n<h1>{{_self|name}} Cards</h1>\n<blockquote>\n<p>{{+*type+by name}}</p>\n</blockquote>'),(6716,'2014-07-25 13:33:45',943,1,'<p>{{+description}}</p>\n<p>&nbsp;</p>\n<p>[[/new/{{_self|linkname}}|add {{_self|name}} card]]</p>\n<p>&nbsp;</p>\n<h1>{{_self|name}} Cards</h1>\n<blockquote>\n<p>{{+*type+by name}}</p>\n</blockquote>'),(6717,'2014-07-25 13:33:45',944,1,'<p>{{+description}}</p>\n<p>&nbsp;</p>\n<p>[[/new/{{_self|linkname}}|add {{_self|name}} card]]</p>\n<p>&nbsp;</p>\n<h1>{{_self|name}} Cards</h1>\n<blockquote>\n<p>{{+*type+by name}}</p>\n</blockquote>'),(6718,'2014-07-25 13:33:45',945,1,'{\"type\":\"_self\"}'),(6719,'2014-07-25 13:33:45',946,1,'[[Administrator]]'),(6720,'2014-07-25 13:33:45',947,1,'[[Administrator]]'),(6721,'2014-07-25 13:33:45',948,1,'[[Administrator]]'),(6722,'2014-07-25 13:33:45',949,1,'{\"type\":\"_self\"}'),(6723,'2014-07-25 13:33:45',950,1,'[[Administrator]]'),(6724,'2014-07-25 13:33:45',951,1,'[[Administrator]]'),(6725,'2014-07-25 13:33:45',952,1,'[[Administrator]]'),(6726,'2014-07-25 13:33:45',953,1,''),(6727,'2014-07-25 13:33:45',954,1,'{\"right\":\"_self\"}'),(6728,'2014-07-25 13:33:45',955,1,''),(6729,'2014-07-25 13:33:45',956,1,'[[Anyone]]'),(6730,'2014-07-25 13:33:45',957,1,'{\"type\":\"Skin\"}'),(6731,'2014-07-25 13:33:45',958,1,'select'),(6732,'2014-07-25 13:33:45',959,1,'Skin (collection of stylesheets) for card\'s page. [[http://wagn.org/skins|more]]'),(6733,'2014-07-25 13:33:45',960,1,''),(6734,'2014-07-25 13:33:45',961,1,''),(6735,'2014-07-25 13:33:45',962,1,''),(6740,'2014-07-25 13:33:45',967,1,'[[style: jquery-ui-smoothness]]\n[[style: functional]]\n[[style: standard]]\n[[style: right sidebar]]\n[[style: common]]'),(6741,'2014-07-25 13:33:45',968,1,'[[simple skin]]\n[[style: classic cards]]\n[[style: traditional]]'),(6754,'2014-07-25 13:33:45',971,1,'{\"type\":\"_self\"}'),(6755,'2014-07-25 13:33:45',972,1,'[[Administrator]]'),(6756,'2014-07-25 13:33:45',973,1,'[[Administrator]]'),(6757,'2014-07-25 13:33:45',974,1,'[[Administrator]]'),(6758,'2014-07-25 13:33:45',109,1,'<div>Thank you for signing up to {{*title|core}}. Someone will receive your request for an account and approve it as soon as possible.</div>'),(6761,'2014-07-25 13:33:45',963,1,'/*\nThis stylesheet defines a simple layout with the sidebar at right.\n*/\n\n\n#primary {\n  margin: 0 1% 3em 1%;\n  float: left;\n  width: 67%;\n}\n#secondary {\n  margin: 0 1% 3em 1%;\n  float: right;\n  width: 28%;\n}\n\n\n@media print {\n  #primary { \n    width: 100%;\n    float: none;\n    margin: 0;\n  }\n  #secondary {\n    display: none;\n  }\n}\n'),(6770,'2014-07-25 13:33:45',965,1,'/* \nThis stylesheet defines the core rules of the \"classic\" Wagn look.\n*/\n\nbody {\n  font: 12px verdana, arial, helvetica, sans-serif;\n  background: #ccc;\n  color: #444;\n  margin: 0px;\n  min-width: 480px;\n}\n\n.card-frame {\n  margin: 1px 0;\n  -moz-border-radius: 8px;\n  border-radius: 8px;\n  border: 1px solid #aaa;\n  border-bottom: 2px solid #ccc;\n  border-right: 2px solid #ccc;\n  background: #fff;\n  margin: 0;\n  padding: 0 !important;\n  > .card-body {\n    min-height: 20px;\n  }\n  > .card-header {\n    margin: 0;\n    color: #333333;\n    background: #8AB;\n    text-align: left;\n    .toggler {\n      top: 2px;\n    }\n  }\n  > .instruction {\n    color: #440;\n    background: #ddc;\n  }  \n}\n\n\n\n\n/*------------- closed view -------*/\n.closed-view {\n  border: 0;\n  border-bottom: 1px solid #ccc;\n  -moz-border-radius: 0 !important;\n  border-radius: 0 !important;\n  .card-header {\n    vertical-align: middle;\n    -moz-border-radius: 0 6px 6px 0;\n    border-radius: 0 6px 6px 0;\n    margin-right: 4px;\n  }\n}\n\n\n.errors-view > .card-body {\n  border: 2px solid #b44;\n  background: #ffb;\n}\n\n\n/*--------- links --------------*/\na {\n  color: #279;\n}\na.wanted-card {\n  color: #990000;\n}\na.email-link {\n  color: #997799;\n}\n\n\n\n/*-- misc --*/\n\np {\n  line-height: 1.5em;\n}\npre {\n  background-color: #e5f0f5;\n  padding: 10px;\n}\nli {\n  margin-bottom: 2px;\n}\nhr {\n  margin: 10px\n}\n\n\n.card-notice {\n  color: #009;\n}\n.joint {\n  color: #960;\n}\n\n'),(6775,'2014-07-25 13:33:45',966,1,'/*\r\nThis \"traditional\" styling is for backwards compatibility.  It is not intended for use in Wagns created after version 1.12.\r\n\r\nThere are three types of rules here:\r\n  1. rules applying to selectors no longer included in standard layouts (#menu, #logo, #credit)\r\n  2. rules enforcing now-deprecated styling patterns\r\n  3. rules enforcing default content expected to change soon\r\n\r\n*/\r\n\r\n@mixin no_external_icon {\r\n  list-style-type: none;\r\n  padding-right: 0 !important;\r\n  background: inherit;\r\n}\r\n\r\n\r\n/* #menu is being replaced with #header */\r\n#menu {\r\n  font-size: 14px;\r\n  background: #8AB;\r\n  margin-bottom: 20px;\r\n  padding: 2px;\r\n a {\r\n    color: #000;\r\n    padding: 0px 4px;\r\n  }\r\n  div {\r\n    display: inline;\r\n  }\r\n  #logging {  /* signing in and out */\r\n    float:right;\r\n    right: 0.5%;\r\n    top: 2px;\r\n  }\r\n  #my-card-link {\r\n    font-weight: bold;\r\n  }\r\n  .navbox {\r\n    height: 18px;\r\n    width: 30%;\r\n  }\r\n}\r\n@media print {\r\n  #menu {\r\n    display: none;\r\n  }\r\n}\r\n\r\n\r\n/* -------  Secondary --------- */\r\n\r\n/* #logo is being replaced with *logo card slot wrappers */\r\n#logo {\r\n  text-align: center;\r\n  padding: 10px;\r\n  background: #fff;\r\n  border: 1px solid #777;\r\n  -moz-border-radius: 8px;\r\n  border-radius: 8px;\r\n  a,\r\n  a:link,\r\n  a:visited {\r\n    color: #448;\r\n    text-decoration: none;\r\n    text-align: center;\r\n  }\r\n  img {\r\n    max-width: 100%;\r\n  }\r\n}\r\n\r\n/* #credit is being replaced with *credit card slot wrappers */\r\n#credit {\r\n  margin: 30px 0;\r\n}\r\n\r\n\r\n/* the logo and credit will not be in the sidebar in most new layouts */\r\n\r\n#secondary {\r\n  > div {\r\n    > a > .SELF-Xlogo.content-view,\r\n    > .SELF-Xcredit.content-view {\r\n      display: block;\r\n      text-align: center;\r\n      padding: 10px;\r\n      background: #fff;\r\n      border: 1px solid #bbb;\r\n      -moz-border-radius: 8px;\r\n      border-radius: 8px;\r\n      img {\r\n        max-width: 100%;\r\n      }\r\n      a {\r\n        color: #186886; /* NOTGREY - Wagn blue */\r\n      }\r\n    }\r\n  }  \r\n}\r\n\r\n\r\n/*\r\nThe following are specifically NOT recommended but are included here to avoid disrupting behavior in old sites\r\n*/\r\n\r\n/* best not to overspecify these properties */\r\nbody, p, ol, ul, td, th, textarea {\r\n  font-family: verdana, arial, helvetica, sans-serif;\r\n  font-size:   12px;\r\n  font-weight: normal;\r\n}\r\n\r\nbody, p, ol, ul {\r\n  line-height: 21px;\r\n}\r\n\r\n.closed-content {\r\n  font-size: 11px !important;\r\n}\r\n\r\n/* creates lots of inline divs.  confusing */\r\n.content-view {\r\n  display: inline;\r\n}\r\n\r\n/* english content in css.  ugh */\r\n.search-no-results:after {\r\n  content:\'0 results\';\r\n}\r\n.closed-content .search-no-results:after {\r\n  content:\'\';\r\n}\r\n\r\n/* many sites may want this external link behavior; it\'s here because it\'s a nuisance to override when not desired */\r\n\r\na.external-link,\r\n.closed-content a.external-link {\r\n  color: #729;\r\n  background: url([[/assets/external_link.png]]) center right no-repeat;\r\n  padding-right: 13px !important;\r\n}\r\n\r\n.SELF-home-original > .card-content p,\r\n.SELF-wagneer_menu > .card-content {\r\n  a.external-link {\r\n    list-style-type: none;\r\n    padding-right: 0 !important;\r\n    background: inherit;\r\n  }\r\n}\r\n'),(6776,'2014-07-25 13:33:45',314,1,'<!DOCTYPE HTML>\r\n<html>\r\n  <head>\r\n    {{*head}}\r\n  </head>\r\n  \r\n  <body>\r\n    <div id=\"menu\">\r\n      [[/ | Home]]   [[/recent | Recent]]   {{*navbox}} {{*account links}}\r\n    </div>\r\n    \r\n    <div id=\"primary\">\r\n      {{_main}}\r\n    </div>\r\n    \r\n    <div id=\"secondary\">\r\n      {{*sidebar}}\r\n    </div>\r\n  </body>\r\n</html>'),(6782,'2014-07-25 13:33:45',53,1,'{\r\n\"width\":\"100%\",\r\n\"auto_resize\":true,\r\n\"relative_urls\":false,\r\n\"theme\":\"advanced\",\r\n\"theme_advanced_buttons1\":\"formatselect,bold,italic,separator,blockquote,bullist,numlist,hr,separator,code\",\r\n\"theme_advanced_buttons2\":\"\",\r\n\"theme_advanced_buttons3\":\"\",\r\n\"theme_advanced_path\":false,\r\n\"theme_advanced_toolbar_location\":\"top\",\r\n\"theme_advanced_toolbar_align\":\"left\",\r\n\"theme_advanced_resizing\":true,\r\n\"theme_advanced_resize_horizontal\":false,\r\n\"theme_advanced_statusbar_location\":\"bottom\",\r\n\"theme_advanced_blockformats\":\"p,h1,h2\",\r\n\"extended_valid_elements\":\"a[name|href|target|title|onclick],img[class|src|border=0|alt|title|hspace|vspace|width|height|align|onmouseover|onmouseout|name],hr[class|width|size|noshade],font[face|size|color|style],span[class|align|style]\"\r\n}'),(6788,'2014-07-25 13:33:45',975,1,'1'),(6799,'2014-07-25 13:33:45',773,1,'{\"type\":\"role\", \"not\":{\"codename\":[\"in\",\"anyone\",\"anyone_signed_in\"]}}'),(6801,'2014-07-25 13:33:45',67,1,'Signup_Success'),(6802,'2014-07-25 13:33:45',108,1,'Request_Sent'),(6803,'2014-07-25 13:33:45',62,1,'Invite_Success'),(6807,'2014-07-25 13:33:45',56,1,'<p>People can <strong>invite new users via email</strong> if they have [[*account+*right|permission to create +*account]] cards.</p>\r\n<p> </p>\r\n<p>Newy invited users will be sent an email with a password and the following details:</p>\r\n<p> </p>\r\n<h2>Email subject</h2>\r\n<blockquote>\r\n<p>{{+*subject|type:Phrase}}</p>\r\n</blockquote>\r\n<p> </p>\r\n<h2>Email message</h2>\r\n<blockquote>\r\n<p>{{+*message|type:PlainText}}</p>\r\n</blockquote>\r\n<p> </p>\r\n<h2>Email from</h2>\r\n<blockquote>\r\n<p>{{+*from|type:Phrase}}</p>\r\n</blockquote>\r\n<p> </p>\r\n<p><strong>After sending an invitation, you\'re taken here:</strong><span></span></p>\r\n<blockquote>\r\n<div>{{+*thanks}}</div>\r\n</blockquote>'),(6813,'2014-07-25 13:33:45',964,1,'/*\r\nThis stylesheet outlines a host of commonly-used styles.  Unlike the \"standard\" stylesheet, this\r\nsheet will likely affect prominent pages seen even by casual users, so any major style tweaking will\r\nlikely alter some of the style rules below.\r\n\r\nWe do not expect migrations to alter this card frequently\r\n*/\r\n\r\n\r\n$input_color: #f9f9ed;\r\n$input_focus_color: #ffffee;\r\n$label_color: #666666;\r\n$border_color: #999999;\r\n$header_color: #eeeeee;\r\n\r\nh1 {\r\n  font-size: 1.2em;\r\n}\r\nh2 {\r\n  font-size: 1.1em;\r\n}\r\n\r\ntextarea, input {\r\n  font-size: 1em;\r\n  line-height: 1.5em;\r\n}\r\n\r\n/* \r\nthe following gives users more explicit control over spacing within tinyMCE\r\nbut leads to lots of empty paragraph tags\r\n*/\r\n\r\nh1, h2, p {\r\n  margin: 0px;\r\n}\r\n\r\nlabel,\r\n.navbox-item-label {\r\n  color: $label_color;\r\n}\r\ntable {\r\n  border-collapse: collapse;\r\n}\r\nth {\r\n  color: $label_color;\r\n  font-weight: normal;\r\n  font-style: italic;\r\n}\r\ntd, th {\r\n  vertical-align: top;\r\n  padding: 0px;\r\n}\r\na:link,\r\na:visited {\r\n	text-decoration: none;\r\n}\r\na:hover,\r\na:focus {\r\n  text-decoration: underline;\r\n}\r\nform {\r\n  margin: 0px;\r\n  padding: 0px;\r\n}\r\n\r\n\r\n.card-header,\r\n.card-body {\r\n  padding: 5px 0;\r\n}\r\n\r\n.card-frame {\r\n  border: 1px solid $border_color;\r\n  > .card-header {\r\n    background: $header_color;\r\n    padding: 5px 12px;\r\n  }  \r\n  > .card-body {\r\n    padding: 5px 12px;\r\n  }\r\n  > .instruction {\r\n    background: #ccc;\r\n  }  \r\n}\r\n\r\n.card-header > .instruction {\r\n  font-weight: normal;\r\n  font-size: 0.9em;\r\n}\r\n\r\n.closed-view {\r\n  border: 0;\r\n  border-bottom: 1px solid #eee\r\n}\r\n\r\n/*-------- Special Pages --------*/\r\n\r\n/*-- sign in page --*/\r\n\r\n#sign-in input#login_field,\r\n#sign-in input#password,\r\n#forgot-password input#email {\r\n  width: 50%;\r\n}\r\n#forgot-password {\r\n  margin-top: 40px;\r\n}\r\n\r\n\r\n\r\n\r\n/*----------- inputs ---------*/\r\n\r\n\r\ninput[type=text],\r\ninput[type=password],\r\ninput[type=checkbox],\r\ntextarea,\r\nselect {\r\n  border: 1px solid #aaa;\r\n  border-top: 2px solid #666;\r\n  border-left: 2px solid #666;\r\n  background: $input_color;\r\n  :focus {\r\n    background: $input_focus_color;    \r\n  }\r\n}\r\n.history-view > .card-content,\r\n.conflict-view,\r\nbody#tinymce {\r\n  background: $input_color;\r\n}\r\nbody.mceContentBody {\r\n  margin: 4px;\r\n}\r\n\r\n\r\n/*----------- Change View ---------*/\r\n\r\n.change-view {\r\n  padding: 5px 0px;\r\n  border-bottom: 1px dotted $border_color;\r\n  .change-card{\r\n    font-weight: bold;\r\n  }\r\n  .last-update {\r\n    color: $label_color;\r\n  }\r\n}\r\n\r\n\r\n\r\n/*---------- ( Richtext )-------------*/\r\n\r\n.table-of-contents {\r\n  background: $header_color;\r\n  -moz-border-radius: 10px;\r\n  border-radius: 10px;\r\n  padding: 4px;\r\n  margin: 5px 20px 20px 20px;\r\n  h5 {\r\n    margin: 0 0 0 40px;\r\n  }\r\n  ol {\r\n    list-style-type: upper-roman;\r\n    ol {\r\n      list-style-type: upper-alpha;\r\n      padding-left: 25px\r\n    }\r\n  }\r\n}\r\n\r\n\r\n/* CARDTYPE_SPECIFIC ------------------------------*/\r\n\r\n\r\n.TYPE-toggle.card-content {\r\n  font-style: italic;\r\n}\r\n\r\n.TYPE-image.card-content img {\r\n  max-width: 100%;\r\n}\r\n\r\n/*---------( Search ) ---------- */\r\n\r\n.search-keyword {\r\n  font-style: italic;\r\n}\r\n\r\n.search-count {\r\n  float: right;\r\n  color: $label_color;\r\n}\r\n\r\n\r\n/*----------- (Account Request)--------------*/\r\n\r\n.invite-links {\r\n  padding: 10px;\r\n  margin-top: 10px;\r\n  background: $header_color;\r\n  text-align: center;\r\n}\r\n.invite-links a {\r\n  font-weight: bold;\r\n  margin: 0 20px;\r\n}\r\n\r\n\r\n/*---------- comments -------------------------------------- */\r\n\r\n.comment-box {\r\n  padding: 8px;\r\n  margin: 0px;\r\n  input {\r\n    padding: 0px;\r\n  }\r\n  textarea {\r\n    margin-bottom:5px;\r\n  }\r\n}\r\n.w-comment-author {\r\n  font-style: italic;\r\n  margin-left: 10px;\r\n}\r\n'),(6814,'2014-07-25 13:33:45',969,1,'[[classic skin]]'),(6816,'2014-07-25 13:33:45',80,1,'<div>{{## Feel free to get rid of this and start fresh! }}</div>\r\n<div>{{+original}}</div>'),(6819,'2014-07-25 13:33:45',223,1,'{\r\n  \"or\": {\r\n    \"and\": {\r\n      \"right_plus\": [\"*watcher\", {\"refer_to\": \"_self\"} ],\r\n      \"not\": {\"type\": \"Cardtype\"} \r\n    },\r\n    \"type\": {\r\n      \"right_plus\": [\"*watcher\", {\"refer_to\": \"_self\"} ]\r\n    }\r\n  }\r\n}'),(6822,'2014-07-25 13:33:45',588,1,''),(6841,'2014-07-25 13:33:45',100,1,'<p>Unregistered users will see a [[Sign up]] link if [[Anyone]] is permitted to [[*create|create]] [[Sign ups]].</p>\r\n<blockquote>\r\n<p>{{Sign up|titled}}</p>\r\n</blockquote>\r\n<p>Sign ups will be automatically approved if [[Anyone]] can create [[Users]].  Otherwise a permitted user will need to approve the [[Sign Up]] card.</p>\r\n<blockquote>\r\n<p>{{Cards with accounts|titled}}</p>\r\n</blockquote>\r\n<p>[[http://wagn.org/wagn/account| Learn more about accounts.]]</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>'),(6845,'2014-07-25 13:33:45',988,1,''),(6846,'2014-07-25 13:33:45',989,1,''),(6847,'2014-07-25 13:33:45',990,1,''),(6848,'2014-07-25 13:33:45',991,1,''),(6849,'2014-07-25 13:33:45',992,1,''),(6850,'2014-07-25 13:33:45',993,1,''),(6851,'2014-07-25 13:33:45',994,1,'{\"right\":\"_self\"}'),(6852,'2014-07-25 13:33:45',995,1,'[[Administrator]]'),(6853,'2014-07-25 13:33:45',996,1,'{\"right\":\"_self\"}'),(6854,'2014-07-25 13:33:45',997,1,'[[Administrator]]'),(6855,'2014-07-25 13:33:45',998,1,'{\"right\":\"_self\"}'),(6856,'2014-07-25 13:33:45',999,1,'[[Administrator]]'),(6857,'2014-07-25 13:33:45',1000,1,'{\"right\":\"_self\"}'),(6858,'2014-07-25 13:33:45',1001,1,'[[Administrator]]'),(6859,'2014-07-25 13:33:45',1002,1,'[[Administrator]]'),(6860,'2014-07-25 13