ge. '),(6913,'2014-07-25 13:33:45',1050,1,''),(6914,'2014-07-25 13:33:45',1051,1,'{\"right\":\"_self\"}'),(6915,'2014-07-25 13:33:45',1052,1,''),(6916,'2014-07-25 13:33:45',1053,1,'[[_left]]'),(6917,'2014-07-25 13:33:45',1054,1,''),(6918,'2014-07-25 13:33:45',1055,1,'{\"right\":\"_self\"}'),(6919,'2014-07-25 13:33:45',1056,1,''),(6920,'2014-07-25 13:33:45',1057,1,''),(6921,'2014-07-25 13:33:45',1058,1,''),(6922,'2014-07-25 13:33:45',1059,1,''),(6923,'2014-07-25 13:33:45',1060,1,''),(6924,'2014-07-25 13:33:45',1061,1,''),(6925,'2014-07-25 13:33:45',1062,1,''),(6926,'2014-07-25 13:33:45',1063,1,'[[script: jquery]]\n[[script: tinymce]]\n[[script: slot]]\n[[script: card menu]]\n[[script: jquery helper]]'),(6934,'2014-07-25 13:33:45',63,1,''),(6970,'2014-07-25 13:33:45',73,1,'<h1>Basics</h1>\r\n<div>Set your site name, home card, and logo image:</div>\r\n<blockquote>\r\n<div>{{*title|closed;type:Phrase}}</div>\r\n<div>{{*home|closed;type:Phrase}}</div>\r\n<div>{{*logo|closed;type:Image}}</div>\r\n</blockquote>\r\n<div> </div>\r\n<h1>Rules</h1>\r\n<div>Cards are configured by creating <em>rules</em>.  All the rules impacting a given card can be accessed from its card menu via the \"advanced\" item. Here are the site-wide defaults:</div>\r\n<div>\r\n<blockquote>{{*all|open}}</blockquote>\r\n</div>\r\n<div><em>[[http://wagn.org/rules | More about rules.]]</em></div>\r\n<div> </div>\r\n<h1>Accounts</h1>\r\n<div>Accounts are represented in cards, too. You first create a [[Sign up]] card, and that then turns into a [[User]] card.</div>\r\n<blockquote>\r\n<div>{{Sign up|closed}}</div>\r\n<div>{{User|closed}}</div>\r\n</blockquote>\r\n<div>\r\n<ul>\r\n<li>When [[Anyone]] can [[*create|create]] a [[Sign up]] card, links to sign up will appear.</li>\r\n<li>When [[Anyone]] can [[*create|create]] a [[User]] card, sign-ups can be authenticated with a token.</li>\r\n<li>When only other [[Roles]] can [[*create|create]] a [[User]] card, sign-ups must be approved by hand. </li>\r\n</ul>\r\n</div>\r\n<div><em>[[http://wagn.org/account | More about accounts.]]</em></div>\r\n<div> </div>\r\n<blockquote>\r\n<div> </div>\r\n<div> </div>\r\n</blockquote>'),(6971,'2014-07-25 13:33:45',216,1,'<p>[[Sign up]] cards represent not-yet-approved accounts.  When approved, they become [[User]] cards.  [[http://wagn.org/account|more]]</p>'),(6976,'2014-07-25 13:33:45',69,1,'<div>Thank you for signing up with {{*title}}. You should receive a response in your email.</div>');
